import { Icons } from "@/components/Icons";
import { ImageResponse } from "next/og";
import { NextResponse } from "next/server";

export const runtime = "edge";

const font = fetch(new URL("./lato.ttf", import.meta.url)).then((res) =>
    res.arrayBuffer()
);

export async function GET(request) {
    try {
        const { searchParams } = new URL(request.url);
        const rawTitle = searchParams.get("title") || "Writely";
        const title =
            rawTitle.charAt(0).toUpperCase() + rawTitle.slice(1, 80).trim();

        return new ImageResponse(
            (
                <div
                    style={{
                        width: 1200,
                        height: 630,
                        backgroundImage:
                            "url(https://images.unsplash.com/photo-1557683316-973673baf926?auto=format&fit=crop&w=1200&q=30)",

                        backgroundSize: "cover",
                        backgroundPosition: "center",
                        display: "flex",
                        alignItems: "center",
                        justifyContent: "center",
                        fontFamily: "lato",
                        position: "relative",
                    }}
                >
                    {/* Frosted Glass Card */}
                    <div
                        style={{
                            position: "absolute",
                            inset: 0,
                            background: "linear-gradient(to bottom, rgba(0,0,0,0.5), rgba(0,0,0,0.9))",
                            zIndex: 0,
                        }}
                    />

                    <div
                        style={{
                            zIndex: 1,
                            background: "rgba(255, 255, 255, 0.05)",
                            border: "1px solid rgba(255, 255, 255, 0.15)",
                            borderRadius: "24px",
                            padding: "60px 80px",
                            maxWidth: "90%",
                             //backdropFilter: "blur(10px)",
                            // boxShadow: "0 8px 30px rgba(0, 0, 0, 0.4)",
                            color: "#fff",
                            display: "flex",
                            flexDirection: "column",
                            justifyContent: "space-between",
                            height: "80%",
                            width: "1000px",
                        }}
                    >
                        {/* Top: Logo + Domain */}
                        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                            <img
                                // src={`${process.env.NEXT_PUBLIC_BASE_URL}/writely.jpg`}
                                src="data:image/jpeg;base64,"
                                width={60}
                                height={60}
                                alt="logo"
                            />

                            <span style={{ fontSize: 22, color: "#ccc" }}>writely</span>
                        </div>

                        {/* Title */}
                        <div
                            style={{
                                flexGrow: 1,
                                display: "flex",
                                justifyContent: "center",
                                alignItems: "center",
                                textAlign: "center",
                                fontSize: 64,
                                fontWeight: "bold",
                                lineHeight: 1.2,
                                backgroundImage: "linear-gradient(90deg, #fff, #ccc)",
                                backgroundClip: "text",
                                color: "transparent",
                                textShadow: "0 4px 12px rgba(255,255,255,0.3)",
                            }}
                        >
                            {title}
                        </div>

                        {/* Bottom: Attribution */}
                        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                            <span style={{ fontSize: 24, color: "#aaa" }}>Powered by Writely</span>
                            <span style={{ fontSize: 18, color: "#777" }}>OG Image Generator</span>
                        </div>
                    </div>
                </div>
            ),
            {
                width: 1200,
                height: 630,
                fonts: [
                    {
                        name: "lato",
                        data: await font,
                        style: "italic",
                    },
                ],
            }
        );
    } catch (error) {
        console.error(error.message);
        return NextResponse.json(
            { message: "Failed to Generate the OG Image" },
            { status: 500 }
        );
    }
}
